  function getProducts() {
    fetch('http://127.0.0.1:5000/listUsers')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }

  export default getProducts
  //export {Testi}
